import React from 'react';
import "./Gallery.css"

import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore, {EffectCube, Navigation, Pagination, Scrollbar,} from 'swiper';



import 'swiper/swiper.scss';
import 'swiper/components/effect-cube/effect-cube.scss';




import 'swiper/swiper.scss';
import 'swiper/components/navigation/navigation.scss';
import 'swiper/components/pagination/pagination.scss';
import 'swiper/components/scrollbar/scrollbar.scss';


SwiperCore.use([EffectCube, Navigation, Pagination, Scrollbar,]);







export default function Gallery() {

  return (
      <>



      <div className= "backgroundImage" >


                        <div className="heading-gallery">
                           <h1  >
                            Take a look at some of our work below.
                            </h1>

                            </div>








                    <div className="slideshow">  

                    <Swiper

                        className="swiper-slideshow"
                        effect="cube"

                        pagination={{ clickable: true }}
                        cubeEffect={{ slideShadows: true }}
                        scrollbar={{ draggable: true }}

                        >
                        <SwiperSlide><img className="image" src="./images/slideshowpic1.jpeg" alt=""/><h4>Shaver light installed in a bathroom</h4></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic2.jpeg" alt=""/><h1>Spotlights Installed in a kitchen</h1></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic3.jpeg" alt=""/><h1>Spotlights and smoke alarm installed</h1></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic4.jpeg" alt=""/><h1>Bonding behind kitchen sink</h1></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic5.jpeg" alt=""/><h1>New fuseboard installed and tested</h1></SwiperSlide>
                        <SwiperSlide><img className="image" src="./images/slideshowpic6.jpeg" alt=""/><h1>Bonding</h1></SwiperSlide>



                        </Swiper>





        </div>  

     </div>  

</>


  )}
